import CardList from "./cardList";

const card = ({id, name, type, season})=>{
    return(
        <div className="tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5">
            <img alt="photo" src=""width="100px" height="100px"></img>
            <div>
                <h2>{name}</h2>
                <h3>{type}</h3>
                <h4>{season}</h4>
            </div>
        </div>
    );
}

export default CardList;
